log.info EncryptedCompanyId

if (EncryptedCompanyId==null){
	testRunner.fail("FAIL . Did not find EncryptedCompanyId")
}
else
{
	context.testCase.testSuite.project.setPropertyValue("EncryptedCompanyId",EncryptedCompanyId)
}


// GEtting Role ID




